import React from "react";

const PlayerList = ({ playerList }) => {
    return (
        <div className='row'>
            <div className="column">
                <ul>
                    <button type="button" class="list-group-item list-group-item-action active" disabled>
                        Player:
                    </button>
                    {playerList.map((player, index) =>(
                        <li className="list-group-item list-group-item-primary" key={index}>{player.name}</li>
                    ))}
                </ul>
            </div>
            <div className="column">
                <ul>
                    <button type="button" class="list-group-item list-group-item-action active" disabled>
                        Score:
                    </button>
                    {playerList.map((player, index) =>(
                        <li className="list-group-item list-group-item-primary" key={index}>{player.score}</li>
                    ))}
                </ul>
            </div>
        </div>

    )
};

export default PlayerList;
